var getLogos = function () {
		for(var x = 0; x < globShirts.length; x++){
		
			for(var i = 0; i < logos.length; i++){
			
				if (globShirts[x].filename.toLowerCase().indexOf(logos[i]) > -1)
				{
					if(globShirts[x].filename.toLowerCase().indexOf("black") > -1)
						globShirts[x].logo = logos[i]+"_black";
					else if(globShirts[x].filename.toLowerCase().indexOf("white") > -1)
						globShirts[x].logo = logos[i]+"_white";
					else
						globShirts[x].logo = logos[i];

				}

			}
		}
	}


