function GoToCheckout(){
	var i = 0;
	for (var key in simpleCart.items) { 
		
		var color = simpleCart.items[key].color
		var size = simpleCart.items[key].size
		var qty = simpleCart.items[key].quantity

		console.log(simpleCart.items[key]) 
		console.log('{0},{1},{2}'.f(color,size,qty))
		
		var url = "http://www.kickstartcart.com/SecureCart/SecureCart\
		.aspx?mid=3C8080B0-78D1-4D8B-A163-CA354E8F85F4&\
		pid=58ff0bb0d0f74fc89fe24b28163396c7&\
		q={0}&c={1}&s={2}".f(qty, color, size);

		if(i === 0)
			var cartWindow = window.open(url);
		else
			setTimeout(function() { cartWindow.location = url; }, 1000);

		i++;
	}
}

$(function() {
	// color filter
	$(".color-filter").click(function(){
		var selectedColor = this.id.split("-")[0];
		$(".color-filter-selected").removeClass("color-filter-selected");
		$(".simpleCart_shelfItem").hide();
		$("."+selectedColor).show();
		this.className = "color-filter-selected";
		$("#color-picker").toggle();
		
	});

	$(".logo-filter").click(function(){
		var selectedLogo = this.id;

		$(".logo-filter-selected").removeClass("logo-filter-selected");
		$(".simpleCart_shelfItem").hide();
		$("."+selectedLogo).show();
		this.className += " logo-filter-selected";
		$("#logo-picker").toggle();
		
	});

	// style filter

	$('#style-filter').on('change', function() {
  		if(this.value === "tiedye")
  		{
  			$(".solid-false").show()
  			$(".solid-true").hide()
  		}
  		else if (this.value === "solid") {
  			$(".solid-false").hide()
  			$(".solid-true").show()
  		}
  		else {
  			$(".solid-false").show()
  			$(".solid-true").show()
  		}
	});

	// logo filter
	$("#logo-picker").hide();
	$("#color-picker").hide();

	$("#logo-btn").click( function(){ $("#logo-picker").toggle(); });
	$("#color-btn").click( function() { $("#color-picker").toggle(); });


	$("#expandCart").click(function(){
		if ( $("#sidecart").width() == 800 ){
			$("#sidecart").width(192);
			$("#expandCart").text("Show >>")
		}
		else{
			$("#expandCart").text("<< Hide")
			$("#sidecart").width(800);
		}
	});
});